class Solution:
    def maxOperations(self, nums: list[int], k: int) -> int:
        result : int = 0
        left : int = 0
        right : int = len(nums) -1
        nums.sort()

        while left < right:
            if nums[left] + nums[right] == k:
                result += 1
                left += 1
                right -= 1
            #move the left pointer, as that is the smaller end
            elif nums[left] +  nums[right] < k:
                left += 1
            #moves the right pointer, as that is the larger end
            else:
                right -= 1
        return result
    
